import React from "react";
import { Link } from "react-router-dom";
import Loading from "../Loading";
export default function Header() {
  return (
    <div className="nav-bar">
      <Loading />
      <nav>
        <Link to={"/"}>Home</Link>
        <Link to={"/"}>Account</Link>
        <Link to={"/"}>Setting</Link>
        <a href="/auth/login">Login</a>
      </nav>
    </div>
  );
}
